DROP TABLE IF EXISTS `leadcampus_school`;
CREATE TABLE `leadcampus_school` (
  `school_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '学校id',
  `school_name` varchar(255) NOT NULL COMMENT '学校名称',
  `school_pinyin` varchar(255) NOT NULL COMMENT '学校拼音',
  `isservice` int(11) NOT NULL DEFAULT '0' COMMENT '是否激活（0为激活，1为未激活）',
  PRIMARY KEY (`school_id`),
  KEY `school_name` (`school_name`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='学校表';

