-- ----------------------------
-- Table structure for leadcampus_student
-- ----------------------------
DROP TABLE IF EXISTS `leadcampus_student`;
CREATE TABLE `leadcampus_student` (
  `student_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '学生id',
  `student_name` varchar(255) DEFAULT NULL COMMENT '学生姓名',
  `student_num` varchar(255) NOT NULL COMMENT '学号',
  `student_sex` int(11) NOT NULL DEFAULT '1' COMMENT '1为男 0为女',
  `student_passwd` varchar(255) NOT NULL COMMENT '学生登陆密码',
  `school_name` varchar(11) NOT NULL COMMENT '所在学校id',
  `phone_num` varchar(255) NOT NULL COMMENT '学生手机号',
  `total_mileage` double(255,3) DEFAULT '0.000' COMMENT '跑步总里程',
  `total_time` double(11,0) DEFAULT '0' COMMENT '总时间(分钟)',
  `average_velocity` double(255,3) DEFAULT '0.000' COMMENT '平均配速',
  `heart_rate` int(255) DEFAULT '0' COMMENT '心率',
  `training_days` int(11) DEFAULT '0' COMMENT '训练天数',
  `total_calories` double(255,3) DEFAULT '0.000' COMMENT '总卡路里',
  `student_pic` varchar(255) DEFAULT NULL COMMENT '学生头像',
  `session_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`student_id`),
  KEY `student_school_id` (`school_name`) USING BTREE,
  CONSTRAINT `student_school_name` FOREIGN KEY (`school_name`) REFERENCES `leadcampus_school` (`school_name`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='学生表';

